import React, { useState } from 'react';
import PropTypes from 'prop-types';

const StadiumModal = ({ setShowStadium, club }) => {
  const [selectedStand, setSelectedStand] = useState('kuzey');
  const [newCapacity, setNewCapacity] = useState(100);
  const [buildSpeed, setBuildSpeed] = useState('slow');

  // Stadyum verileri
  const stadiumData = {
    kuzey: { name: 'Kuzey Tribünü', built: '2023', capacity: 100, upgradeMultiplier: 1.0 },
    dogu: { name: 'Doğu Tribünü', built: '2023', capacity: 200, upgradeMultiplier: 1.5 },
    guney: { name: 'Güney Tribünü', built: '2023', capacity: 100, upgradeMultiplier: 1.0 },
    bati: { name: 'Batı Tribünü', built: '2023', capacity: 200, upgradeMultiplier: 1.5 },
    koseler: { name: 'Tribün Köşeleri', built: '-', capacity: 0, upgradeMultiplier: 0.8 },
    saha: { name: 'Saha', built: '2023', capacity: 600, level: 46, maxLevel: 99, upgradeMultiplier: 2.0 }
  };

  const calculateBuildCost = (capacity, speed) => {
    const baseCost = capacity * 10;
    return speed === 'fast' ? baseCost * 1.5 : baseCost;
  };

  const calculateBuildTime = (capacity, speed) => {
    const baseTime = Math.ceil(capacity / 50);
    return speed === 'fast' ? Math.ceil(baseTime / 2) : baseTime;
  };

  const buildCost = calculateBuildCost(newCapacity, buildSpeed);
  const buildTime = calculateBuildTime(newCapacity, buildSpeed);

  const handleCapacityChange = (change) => {
    const newValue = Math.max(0, Math.min(1000, newCapacity + change));
    setNewCapacity(newValue);
  };

  const handleRebuild = () => {
    // Burada stadyum güncelleme işlemi yapılacak
    alert(`${stadiumData[selectedStand].name} yeniden inşa edildi! Kapasite: ${newCapacity}`);
    setShowStadium(false);
  };

  const totalCapacity = Object.values(stadiumData).reduce((sum, stand) => sum + stand.capacity, 0);

  return (
    <div className="fc-modal-backdrop">
      <div className="fc-modal" style={{ maxWidth: '600px', maxHeight: '90vh', overflow: 'auto' }}>
        <div style={{ 
          background: 'linear-gradient(135deg, #2c466b, #1a365d)',
          padding: '20px',
          borderRadius: '8px 8px 0 0',
          color: 'white',
          textAlign: 'center'
        }}>
          <div style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '10px' }}>
            ESTADIO MUNICIPAL
          </div>
          <div style={{ fontSize: '16px' }}>
            Toplam Kapasite: {totalCapacity}
          </div>
        </div>

        <div className="fc-panel" style={{ padding: '20px' }}>
          {/* Stadyum Görseli */}
          <div style={{ 
            textAlign: 'center', 
            marginBottom: '20px',
            background: 'linear-gradient(180deg, #87CEEB, #98FB98)',
            padding: '20px',
            borderRadius: '8px'
          }}>
            <div style={{ 
              width: '200px', 
              height: '120px', 
              margin: '0 auto',
              background: '#228B22',
              border: '3px solid #8B4513',
              borderRadius: '8px',
              position: 'relative'
            }}>
              {/* Saha çizgileri */}
              <div style={{
                position: 'absolute',
                top: '50%',
                left: '50%',
                width: '60px',
                height: '60px',
                border: '2px solid white',
                borderRadius: '50%',
                transform: 'translate(-50%, -50%)'
              }}></div>
              <div style={{
                position: 'absolute',
                top: '50%',
                left: '50%',
                width: '2px',
                height: '100%',
                background: 'white',
                transform: 'translate(-50%, -50%)'
              }}></div>
            </div>
          </div>

          {/* Stadyum Bilgileri */}
          <div style={{ marginBottom: '20px' }}>
            <h4 style={{ 
              margin: '0 0 15px 0', 
              textAlign: 'center', 
              color: 'var(--blue)',
              fontSize: '18px'
            }}>
              STADYUM BİLGİLERİ
            </h4>
            
            <div style={{ 
              background: '#f5f5f5', 
              padding: '15px', 
              borderRadius: '8px',
              fontSize: '14px'
            }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span>Kuzey Tribünü:</span>
                <span>İnşa Edildi: 2023 | Kapasite: 100</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span>Doğu Tribünü:</span>
                <span>İnşa Edildi: 2023 | Kapasite: 200</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span>Güney Tribünü:</span>
                <span>İnşa Edildi: 2023 | Kapasite: 100</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span>Batı Tribünü:</span>
                <span>İnşa Edildi: 2023 | Kapasite: 200</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span>Tribün Köşeleri:</span>
                <span>İnşa Edildi: - | Kapasite: 0</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', fontWeight: 'bold' }}>
                <span>Saha (46/99):</span>
                <span>Toplam Kapasite: 600</span>
              </div>
            </div>
          </div>

          {/* Tribün Seçimi */}
          <div style={{ marginBottom: '20px' }}>
            <h4 style={{ 
              margin: '0 0 15px 0', 
              textAlign: 'center', 
              color: 'var(--blue)',
              fontSize: '16px'
            }}>
              TRIBÜN SEÇİMİ
            </h4>
            
            <div style={{ 
              display: 'grid', 
              gridTemplateColumns: 'repeat(2, 1fr)', 
              gap: '10px',
              marginBottom: '15px'
            }}>
              {Object.keys(stadiumData).map((stand) => (
                <button
                  key={stand}
                  onClick={() => setSelectedStand(stand)}
                  style={{
                    background: selectedStand === stand ? 'var(--win)' : '#f0f0f0',
                    color: selectedStand === stand ? 'white' : '#333',
                    border: 'none',
                    padding: '10px',
                    borderRadius: '6px',
                    cursor: 'pointer',
                    fontSize: '12px'
                  }}
                >
                  {stadiumData[stand].name}
                </button>
              ))}
            </div>
          </div>

          {/* Kapasite Ayarlama */}
          <div style={{ marginBottom: '20px' }}>
            <h4 style={{ 
              margin: '0 0 15px 0', 
              textAlign: 'center', 
              color: 'var(--blue)',
              fontSize: '16px'
            }}>
              KAPASİTE AYARLAMA
            </h4>
            
            <div style={{ 
              display: 'flex', 
              alignItems: 'center', 
              justifyContent: 'space-between',
              padding: '15px',
              background: '#f5f5f5',
              borderRadius: '8px',
              marginBottom: '15px'
            }}>
              <button 
                onClick={() => handleCapacityChange(-50)}
                style={{
                  background: 'var(--loss)',
                  color: 'white',
                  border: 'none',
                  padding: '8px 12px',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  fontSize: '14px',
                  fontWeight: 'bold'
                }}
              >
                &lt;&lt; 50
              </button>
              <button 
                onClick={() => handleCapacityChange(-10)}
                style={{
                  background: 'var(--loss)',
                  color: 'white',
                  border: 'none',
                  padding: '8px 12px',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  fontSize: '14px',
                  fontWeight: 'bold'
                }}
              >
                &lt; 10
              </button>
              <div style={{ 
                fontSize: '24px', 
                fontWeight: 'bold', 
                color: 'var(--blue)',
                background: 'white',
                padding: '10px 20px',
                borderRadius: '8px',
                border: '2px solid var(--blue)'
              }}>
                {newCapacity}
              </div>
              <button 
                onClick={() => handleCapacityChange(10)}
                style={{
                  background: 'var(--win)',
                  color: 'white',
                  border: 'none',
                  padding: '8px 12px',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  fontSize: '14px',
                  fontWeight: 'bold'
                }}
              >
                10 &gt;
              </button>
              <button 
                onClick={() => handleCapacityChange(50)}
                style={{
                  background: 'var(--win)',
                  color: 'white',
                  border: 'none',
                  padding: '8px 12px',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  fontSize: '14px',
                  fontWeight: 'bold'
                }}
              >
                50 &gt;&gt;
              </button>
            </div>
          </div>

          {/* İnşa Detayları */}
          <div style={{ marginBottom: '20px' }}>
            <h4 style={{ 
              margin: '0 0 15px 0', 
              textAlign: 'center', 
              color: 'var(--blue)',
              fontSize: '16px'
            }}>
              İNŞA DETAYLARI
            </h4>
            
            <div style={{ 
              background: '#f0f8ff', 
              padding: '15px', 
              borderRadius: '8px'
            }}>
              <div style={{ marginBottom: '10px' }}>
                <span style={{ fontWeight: 'bold' }}>İnşa Hızı:</span>
                <div style={{ display: 'flex', gap: '10px', marginTop: '5px' }}>
                  <button
                    onClick={() => setBuildSpeed('slow')}
                    style={{
                      background: buildSpeed === 'slow' ? 'var(--win)' : '#f0f0f0',
                      color: buildSpeed === 'slow' ? 'white' : '#333',
                      border: 'none',
                      padding: '8px 16px',
                      borderRadius: '4px',
                      cursor: 'pointer',
                      fontSize: '12px'
                    }}
                  >
                    Yavaş
                  </button>
                  <button
                    onClick={() => setBuildSpeed('fast')}
                    style={{
                      background: buildSpeed === 'fast' ? 'var(--win)' : '#f0f0f0',
                      color: buildSpeed === 'fast' ? 'white' : '#333',
                      border: 'none',
                      padding: '8px 16px',
                      borderRadius: '4px',
                      cursor: 'pointer',
                      fontSize: '12px'
                    }}
                  >
                    Hızlı
                  </button>
                </div>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span style={{ fontWeight: 'bold' }}>İnşa Maliyeti:</span>
                <span style={{ color: 'var(--loss)', fontWeight: 'bold' }}>{buildCost.toLocaleString()} TL</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
                <span style={{ fontWeight: 'bold' }}>İnşa Süresi:</span>
                <span style={{ color: 'var(--blue)', fontWeight: 'bold' }}>{buildTime} hafta</span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                <span style={{ fontWeight: 'bold' }}>Banka Bakiyesi:</span>
                <span style={{ color: 'var(--win)', fontWeight: 'bold' }}>{club.money.toLocaleString()} TL</span>
              </div>
            </div>
          </div>
        </div>

        <div className="fc-footerbar">
          <button 
            className="fc-btn" 
            onClick={() => setShowStadium(false)}
          >
            Geri
          </button>
          <button 
            className="fc-btn" 
            style={{ background: 'var(--win)' }}
            onClick={handleRebuild}
          >
            Yeniden İnşa Et
          </button>
        </div>
      </div>
    </div>
  );
};

StadiumModal.propTypes = {
  setShowStadium: PropTypes.func.isRequired,
  club: PropTypes.object.isRequired,
};

export default StadiumModal;
